                        <div className="header-khoi-sp d-flex">

                            <div className="sort d-flex ml-auto">
                            </div>
                        </div>

                        {/* các sản phẩm  */}
                        <div className="items">
                            <div className="row">
                                {ketqua && ketqua.length > 0 && ketqua.map((item) => {
                                    return (
                                        <>
                                            <div className="col-lg-3 col-md-4 col-xs-6 item MarieForleo" key={item.id}>
